import React, { useState, useEffect, useContext } from 'react';
import { Link } from 'react-router-dom';
import { Avatar, Dropdown, Menu, Modal, Button, Divider } from 'antd';
import logo from '../images/logo.png';
import './Navbar.css';

function Navbar() {
    const [click, setClick] = useState(false);

    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => { setClick(false); }

    return (
        <>
            <nav className='navbar'>
                <div className='navbar-container'>
                    <Link to='/' className='navbar-logo' onClick={closeMobileMenu}>
                        <img style={{ width: "50px" }} shape="circle" src={logo} />
                        <div style={{ marginLeft: '10px' }}><p className='nav-title1'>Spacestagram</p> <p className='nav-title2'>Image-sharing from NASA</p>
                        </div>
                    </Link>
                    <div className='menu-icon' onClick={handleClick}>
                        <p style={{ color: "white" }}>aaa</p>
                        <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
                    </div>
                    <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                        <li className='nav-item'>
                            <Link to='/' className='nav-links' onClick={closeMobileMenu}>
                                Home
                            </Link>
                        </li>
                        <li className='nav-item'>
                            <Link
                                to='/likes'
                                className='nav-links'
                                onClick={closeMobileMenu}
                            >
                                Likes
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
